"use strict";
const InputNode = require("../core/InputNode.js");
const THREE = require("three");
class Vector4Node extends InputNode {
  constructor(value = new THREE.Vector4()) {
    super("vec4");
    this.value = value;
    Object.defineProperty(this, "isVector4Node", { value: true });
  }
}
module.exports = Vector4Node;
